function ExpenseItem() {
  return (
    <div>
      <div className="date">
        <div className="month">March</div>
        <div className="year">2021</div>
        <div className="day">12</div>
      </div>
      <div className="title">New TV</div>
      <div className="cost">$799.49</div>
    </div>
  );
}

export default ExpenseItem;
